	public int lengthOfLongestSubstring(String s) {
        StringBuilder sb = new StringBuilder();
        Set<String> existsSet = new HashSet<String>();
        String targetStr = "";
        int i,start;
        i = 0;
        start = 0;
        while(i<s.length()){
            char c = s.charAt(i);            
            if (!existsSet.contains(String.valueOf(c))){
                sb.append(c);
                existsSet.add(String.valueOf(c));
                i++;
            }else{
                if (targetStr.length() < sb.length()){
                    targetStr = sb.toString();
                }
                sb.delete(0, sb.length());
                existsSet.clear();
                start++;
                i = start;
            }
        }
        
        if (targetStr.length() < sb.length()){
            targetStr = sb.toString();
        }
        
        
        return targetStr.length();
        
    }
	

